import React, { useState, useEffect } from "react";
import { useHistory } from "react-router-dom";
import { Spinner } from 'react-bootstrap';
import "bootstrap/dist/css/bootstrap.min.css";
import "./styles.scss";

const FormLogin = () => {
  const [user, setUser] = useState("");
  const [password, setPassword] = useState("");

  const history = useHistory();

  return (
    <div className="form">
      <form className="form__container">
        <h2 className="form__container--title">Inicio de Sesión</h2>
        <div className="form__container--input-container form-group">
          <input
            className="form__container--input-container--input"
            placeholder="Usuario"
            type="text"
            value={user}
            onChange={(e) => {
              console.log({ user });
              setUser(e.target.value);
            }}
          />
          <input
            className="form__container--input-container--input"
            placeholder="Contraseña"
            type="password"
            value={password}
            onChange={(e) => {
              console.log({ password });
              setPassword(e.target.value);
            }}
          />
        </div>
        <button
          onClick={() => {
            setTimeout(() => {
              <Spinner animation="border" role="status">
                <span className="sr-only">Loading...</span>
              </Spinner>;
            }, 50000);
            // history.push("/home");
          }}
          className="btn form__container--button btn-primary"
        >
          Iniciar sesión
        </button>
      </form>
    </div>
  );
};

export default FormLogin;
